query:
DELETE FROM user_progress 
WHERE userId = 7 AND courseId = 30002 
  AND topicId IN (
    SELECT t.id FROM topics t 
    WHERE t.courseId = 30002
      AND NOT EXISTS (
        SELECT 1 FROM question_progress qp 
        WHERE qp.userId = 7 AND qp.topicId = t.id
      )
  );

